import { useState } from "react"
import { useLogin } from "../hooks/AdminLogin"
import { renderMatches, useNavigate } from "react-router-dom";
//import Admin from "./pages/Admin";
import { Link } from 'react-router-dom'
import jsPDF from 'jspdf';




const Notes = () => {



  const [notes, setNotes] = useState('')


  const handleSubmit = async (e) => {
    e.preventDefault()

    const paramss = new URLSearchParams(window.location.search);
    const courseid = paramss.get('course_id');

    var m_names = new Array("January", "February", "March", 
    "April", "May", "June", "July",
    "August", "September", 
    "October", "November", "December");

var today = new Date();
var curr_date = today.getDate();
var curr_month = today.getMonth();
var curr_year = today.getFullYear();

today = m_names[curr_month] + " " + curr_date + ", " + curr_year;
var newdat = today;


var doc = new jsPDF('p', 'pt');
// template 

var imgData= 'data:image/png;base64,'



doc.addImage(imgData, 'png', 1, 1, 600, 900);

//date
doc.setFont("italic");
doc.setFontSize(10);
doc.setTextColor(166,96,124)
doc.text(470, 74, newdat);

//title 
doc.addFont('Helvertica', 'bold')
       doc.setFontSize(20);
       doc.setTextColor(255,255,255)
       doc.text(190, 250,'Notes for Course ' + JSON.stringify(courseid))

//text      
doc.addFont('Helvertica', 'normal')
doc.setFontSize(13);
doc.setTextColor(255,255,255)

doc.text(80, 300, JSON.stringify(notes))

 

doc.save('notes.pdf')


  }
  

  return (
    <form className="notes" onSubmit={handleSubmit}>
      
      <label className="label2">Notes</label>
      <input 
        type="text" 
        onChange={(e) => setNotes(e.target.value)} 
        value={notes} 
      />

      
      
        <div style ={{textAlign : 'center'}}><br/>
        <button>Download PDF</button>
            </div>
       
         </form>
  )


}

export default Notes